import React, { Component } from 'react'

export default function Title ({name, title}) {

    return (
      <div className="product-list">
          <div className="heading">
              <h1 className="heading-text">
    {name} <strong className="text-blue">{title}</strong>
              </h1>
          </div>

      </div>
    )
}
